"use strict";function contactUsController(n,t){n.sendEmail=function(){if(n.contactForm.$valid){var i=n.contactForm;t.sendEmail(i).then(function(){swal("Mensaje Enviado!","Gracias por ponerse en contacto con nosotros en breve uno de nuestros asesores lo contactara!","success")},function(){swal("Error","Ocurrio un error al guardar su informacion por favor intente mas tarde.","error")})}}}function contactUsServices(n){this.sendEmail=function(t){return n.one("api/ContactUs").post("",t)}}angular.module("mexacodeApp",["restangular"]);angular.module("mexacodeApp").controller("contactUsController",contactUsController);contactUsController.$inject=["$scope","contactUsServices"];angular.module("mexacodeApp").service("contactUsServices",contactUsServices);contactUsServices.$inject=["Restangular"];